import React from 'react';
import './styles/Navbar.css'; // Asegúrate de crear este archivo CSS

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="nav-list">
        <li className="nav-item"><a href="#!">All Categories</a></li>
        <li className="nav-item"><a href="#!">Category 1</a></li>
        <li className="nav-item"><a href="#!">Category 2</a></li>
        <li className="nav-item"><a href="#!">Category 3</a></li>
        <li className="nav-item"><a href="#!">Category 4</a></li>
        <li className="nav-item"><a href="#!">Category 5</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
